window.bookSummaryJSON = "<p>After a long demonic winter, Tree-Tree reawakens and rebuilds. This time, Tree-Tree aims higher, and tries to build something meant to last in a world filled with heroes and demons. Tree-Tree's new growing empire now faces the crusades from unfriendly faiths, more demons, and unhelpful heroes, as Tree-Tree spreads his roots and Empire across the Central Continent.</p> <p>Book three of an epic reincarnation/Isekai LitRPG story about a man who becomes a tree, growing and progressing throughout the ages in an eternal conflict against a demon incursion.</p>"; 
